Op een dag, in Teletubbieland;
Tinky Winky, Dipsy, Laa-laa en Po zijn druk bezig als er iets in de lucht verschijnt. Het is een twinkelende wolk. Dan verschijnen er meer twinkelende wolken en begint het te sneeuwen. Het sneeuwt en sneeuwt en sneeuwt tot alles in Teletubbyland bedekt is onder een dikke laag sneeuw.

- In Finland zingen kinderen een kerstliedje over elfjes.
- Zelfs de lievelingsdingen van de Teletubbies verdwijnen onder de sneeuw.
- In Engeland klappen de kinderen in hun handen als ze een kerstliedje zingen.
- De Teletubbies spelen met de slee in de sneeuw.
- In Spanje halen kinderen cadeautjes uit hun kerstcake.
- Een grote sneeuwbal rolt door heel Telletubbyland en rolt het huis binnen; Uh-oh!

